import React from "react";

function KittenCard({kittens}) {
    return (
        <div className="kitten-gallery">
            <p>Here is text</p>
            {kittens.map((kitten) => (
                <div key={kitten.id} className="kitten-card">
                <img src={kitten.image} alt={`Kitten ${kitten.id}`}/>
            </div>
            ))}
        </div>
    )
}

export default KittenCard;
